import React from 'react';
import logo from './Yorkshire-Water-logo.jpg';
import arrow_1 from './yw-arrow-1.svg';
import './App.css';
import {Button} from 'react-bootstrap';
import {Tab} from 'react-bootstrap';
import {Tabs} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <Tabs defaultActiveKey="profile" id="uncontrolled-tab-example">
      <Tab eventKey="profile" title="Model">
    <div>
    <div>
        <img src={logo} alt="logo" width="400" height="200"/>
    </div>

    <div class = "central-container">
        <style type="text/css">
          {`.btn-xxl {
            padding: 2rem 3rem;
            font-size: 2rem;
          }
          `}
        </style>

        <Button variant="outline-primary" size="xxl">
          Data Input
        </Button>

        <img src={arrow_1} alt="arrow_1" width="70" height="150"/>

        <Button variant="outline-primary" size="xxl">
          Run Model
        </Button>

        <img src={arrow_1} alt="arrow_1" width="70" height="150"/>

        <Button variant="outline-primary" size="xxl">
          Get Results
        </Button>
    </div>

    <div class = "lower-container"> 
          <style type="text/css">
            {`.btn-xxl {
              padding: 2rem 3rem;
              font-size: 2rem;
            }
            `}
          </style>
          <Button variant="outline-primary" size="xxl">
          Update Sheets
          </Button>
    </div>
    </div>
    </Tab>
    <Tab eventKey="contact" title="Parameters">
    <div>
        <img src={logo} alt="logo" width="400" height="200"/>
    </div>
    </Tab>

    </Tabs>


);
}

export default App;
